webpackJsonp([6589029996318],{7257:function(e,t){e.exports={data:{post:{html:'<p><a href="http://www.faz.net/s/Rub9E75B460C0744F8695B3E0BE5A30A620/Doc~E6D08E0707D9F4711AB119E5604570F3D~ATpl~Ecommon~Scontent.html" title="You\'re so German! - FAZ.NET - FAZ Weekly">FAZ: You\'re so German!</a> An expat returns home... </p>\n<blockquote><p>The ultimate culture shock, however, hit me during my first visit to the supermarket. Seconds after entering, I noticed a swarm of shop employees honing in on me like heat-seeking missiles. They began barraging me with &rdquo;How are yous.&rdquo; Rather than jumping for joy at the friendly customer service I had missed for so long, all I could think was &rdquo;You don\'t know me!&rdquo; and &rdquo;Why are you pretending like you\'re my best friend?!&rdquo;</p></blockquote>\n<p><a href="http://www.chillmost.com/2005/03/3-articles.html" title=".:C H I L L M O S T - Notes from Germany:.">(via Nate)</a></p>',fields:{title:"You're so German!",date:"19 Mar 2005",url:"https://papascott.de/2005-03-19-youre-so-german/"}}},pathContext:{slug:"/2005-03-19-youre-so-german/",prev:{fields:{title:"Someone Had A Grudge",date:"19 Mar 2005",slug:"/2005-03-19-someone-had-a-grudge/"}},next:{fields:{title:"Stupid Tricks with Active Directory",date:"20 Mar 2005",slug:"/2005-03-20-stupid-tricks-with-active-directory/"}}}}}});
